import React, { useState } from 'react';
import './Footer.css';

const Footer = () => {
  const [email, setEmail] = useState('');

  const handleSubscribe = (e) => {
    e.preventDefault();
    if (email) {
      // Handle newsletter subscription
      console.log('Subscribing:', email);
      setEmail('');
      alert('Thank you for subscribing to our newsletter!');
    }
  };

  const socialLinks = [
    { name: 'X (Twitter)', icon: 'ùïè', href: 'https://x.com/monad' },
    { name: 'Discord', icon: 'üí¨', href: 'https://discord.gg/monad' },
    { name: 'YouTube', icon: '‚ñ∂Ô∏è', href: 'https://www.youtube.com/@MonadFoundation' },
    { name: 'GitHub', icon: '‚ö°', href: 'https://github.com/monadxyz' }
  ];

  return (
    <footer className="footer">
      <div className="container">
        <div className="footer-content">
          <div className="footer-top">
            <div className="footer-brand">
              <div className="footer-logo">
                <svg width="40" height="40" viewBox="0 0 40 40" fill="none">
                  <circle cx="20" cy="20" r="18" stroke="url(#gradient)" strokeWidth="2" />
                  <path d="M20 8L28 20L20 32L12 20L20 8Z" fill="url(#gradient)" />
                  <defs>
                    <linearGradient id="gradient" x1="0%" y1="0%" x2="100%" y2="100%">
                      <stop offset="0%" stopColor="#6C3BFF" />
                      <stop offset="100%" stopColor="#8B5CF6" />
                    </linearGradient>
                  </defs>
                </svg>
                <span>Monad</span>
              </div>
              <p className="footer-description">
                High-performance EVM-compatible blockchain powering the next generation of decentralized applications.
              </p>
            </div>

            <div className="footer-social-section">
              <h4>Connect With Us</h4>
              <p>Join our community and stay connected with the latest updates.</p>
              <div className="footer-social">
                {socialLinks.map((social) => (
                  <a
                    key={social.name}
                    href={social.href}
                    target="_blank"
                    rel="noopener noreferrer"
                    className="social-link"
                    aria-label={social.name}
                  >
                    <span className="social-icon">{social.icon}</span>
                  </a>
                ))}
              </div>
            </div>

            <div className="footer-newsletter">
              <h4>Stay Updated</h4>
              <p>Get the latest updates about Monad's development and ecosystem growth.</p>
              <form onSubmit={handleSubscribe} className="newsletter-form">
                <input
                  type="email"
                  placeholder="Enter your email"
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                  required
                  className="newsletter-input"
                />
                <button type="submit" className="newsletter-btn">
                  Subscribe
                </button>
              </form>
            </div>
          </div>

          <div className="footer-bottom">
            <div className="footer-bottom-left">
              <p>&copy; 2026 Monad Foundation. All rights reserved.</p>
            </div>
            <div className="footer-bottom-right">
              <a href="https://www.monad.xyz/terms-of-service" target="_blank" rel="noopener noreferrer">
                Terms of Service
              </a>
              <a href="https://www.monad.xyz/privacy-policy" target="_blank" rel="noopener noreferrer">
                Privacy Policy
              </a>
            </div>
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
